import { useEffect, useState } from "react";
import {
  Address as AddressInterface,
  User as UserInterface,
} from "../../types/User";
import "./UserDetails.scss";
import axios from "axios";

interface UserDetailsProps {
  user: UserInterface;
}

const UserDetails: React.FC<UserDetailsProps> = ({ user }) => {
  const [error, setError] = useState<string | null>(null);
  const emptyAddress: AddressInterface = {
    addressId: "",
    doorNo: "",
    street: "",
    city: "",
  };
  const [address, setAddress] = useState<AddressInterface>(emptyAddress);
  const handleChange = (e: React.ChangeEvent<HTMLInputElement>) => {
    setAddress({ ...address, [e.target.name]: e.target.value });
    setError("");
  };

  const [isLoading, setIsLoading] = useState<boolean>(false);
  const handleSubmit = async (e: React.FormEvent<HTMLFormElement>) => {
    e.preventDefault();
    if (
      address.doorNo.trim() === "" ||
      address.street.trim() === "" ||
      address.city.trim() === ""
    ) {
      setError("*All fields are required");
      return;
    }
    setIsLoading(true);
    try {
      const newAddress: AddressInterface = address;
      const response = await axios.post(
        `http://localhost:8080/address/${user.userId}`,
        newAddress
      );
      setAddress(emptyAddress);
      console.log(response.data);
    } catch (error) {
      setError((error as Error).message);
    } finally {
      setIsLoading(false);
    }
  };

  const [addresses, setAddresses] = useState<AddressInterface[]>([]);

  useEffect(() => {
    const fetchUserAddresses = async () => {
        setIsLoading(true);
        try {
            const response = await axios.get(`http://localhost:8080/users/addressList/${user.userId}`);
            setAddresses(response.data as AddressInterface[]);
        } catch(error) {
            setError((error as Error).message);
        } finally {
            setIsLoading(false);
        }
    }
  }, []);
  return (
    <div>
      <div className="user-details-container">
        <div>
          <p className="user-details-name">{user.userName}</p>
          <p className="user-details">{user.email}</p>
          <p className="user-details">{user.phoneNo}</p>
        </div>

        <div className="add-container">
          <div>
            <p className="heading centered">Add Address</p>
          </div>
          <form onSubmit={handleSubmit}>
            <div className="input-layout mb-2">
              <label>Door No: </label>
              <input
                type="text"
                name="doorNo"
                placeholder="enter doorNo"
                onChange={handleChange}
                className="input-field"
              />
            </div>

            <div className="input-layout mb-2">
              <label>Street: </label>
              <input
                type="text"
                name="street"
                placeholder="enter street"
                onChange={handleChange}
                className="input-field"
              />
            </div>

            <div className="input-layout mb-2">
              <label>City: </label>
              <input
                type="text"
                name="city"
                placeholder="enter city"
                onChange={handleChange}
                className="input-field"
              />
            </div>
            <div className="centered">
              <button className="btn btn-success">
                {isLoading ? "Adding" : "Add Address"}
              </button>
            </div>
            <p className="centered error-text mt-2">{error}</p>
          </form>
        </div>

        <div className="address-container">
          <div className="address-header">
            <p className="heading">Addresses</p>
            <p className="btn btn-primary">
              <b>+</b>
            </p>
          </div>

          <div>
            <p>doorNo</p>
            <p>street</p>
            <p>city</p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default UserDetails;
